function Header() {
  return (
    <div className="Header">
      <center>
        <div className="AP">라이트웨이(light way)</div>
        <img className="AP6" src={"/img/home.png"} />
        <button className="AP1">경기도 부천시</button>
        <img className="AP5" src={"/img/exit.png"} />
        <img className="AP7" src={"/img/search.png"} />
        <img className="AP8" src={"/img/share.png"} />
      </center>
    </div>
  );
}

export default Header;
